import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { Route  } from 'react-router';

import './App.css';

// App layout components
import Scroll from './Components/Scroll/Scroll';
import Navbar from './Components/Layout/Navbar/Navbar';
import Footer from './Components/Layout/Footer/Footer';

// App pages
import Home  from './Components/Home/Home';
import Request from './Components/Pages/Requests/Request'
import Login from './Components/Pages/Login/login'
import offers from './Components/Pages/Offers/Offers'
import Hea from './Components/Pages/Offers/description/Hea'
import Soc from './Components/Pages/Offers/description/Soc'
import Sol from './Components/Pages/Offers/description/Sol'
import Oth from './Components/Pages/Offers/description/Oth'
import Dashboard from './Components/Pages/admin/Dashboard';

function App() {
  return (
    <Router>
        <Scroll />
        <div className='App'>
          <switch >
              <Navbar />
                <Route exact path='/' component={Home} />
                <Route exact path='/requests' component={Request} />
                <Route exact path='/login' component={Login}  />
                <Route exact path='/offers' component={offers}  />
                <Route exact path='/offers/hea' component={Hea} />
                <Route exact path='/offers/soc' component={Soc} />
                <Route exact path='/offers/sol' component={Sol} />
                <Route exact path='/offers/oth' component={Oth} />
              <Footer />

          </switch>
          <Route exact path='/admin' component={Dashboard}  />

        </div>

    </Router>
  );
}

export default App;
